import React, { useRef } from "react";
import Webcam from "react-webcam";

const videoConstraints = {
    width: 1280,
    height: 720,
    facingMode: "user"
};

const Camera2 = () => {

    return (
        <Webcam
            audio={false}
            height={300}
            screenshotFormat="image/jpeg"
            width={400}
            videoConstraints={videoConstraints}
        >
            {({ getScreenshot }) => (
                <button
                    onClick={() => {
                        const imageSrc = getScreenshot()
                    }}
                >
                    Capture photo
                </button>
            )}
        </Webcam>
    );

}

export default Camera2;
